import PropTypes from 'prop-types'
import Autocomplete from "./Autocomplete";


const SearchBox = ({ placeholder }) => {
    return (
        <div className='search-box'>
            <Autocomplete
        suggestions={[
          "Alligator",
          "Bask",
          "Crocodilian",
          "Death Roll",
          "Eggs",
          "Jaws",
          "Reptile",
          "Solitary",
          "Tail",
          "Wetlands"
        ]}
      />
        </div>
    )
}

SearchBox.defaultProps = {
    title: "Google Search",
}

SearchBox.propTypes = {
    title: PropTypes.string.isRequired,
}

